import React from 'react'

import {
    Link
  } from "react-router-dom";

function Menu() {
  return (
    <nav>
        <ul>
            <li><Link to="/ReportsPage"></Link>Reports</li>
            <li><Link to="/AddUserPage"></Link>Add Users</li>
            <li><Link to="/"></Link>Transactions</li>
        </ul>
    </nav>
  );
}

export default Menu;
